const SearchPopup = () => {
  return (
    <div>
      <h1>Search</h1>
      <div>
        <p>Destination</p>
        <input></input>
      </div>
      <div>
        <p>Check-in-Date</p>
        <input></input>
      </div>
      <div>
        <p>Options</p>
        <input>Min price</input>
      </div>
    </div>
  );
};
export default SearchPopup;
